export default function Square({ value, onSquareClick, playersTurn }) {
  const color = value
    ? value > 0
      ? "var(--primary_C)"
      : "var(--secondary_C)"
    : "black";

  const style = { color };

  var classCSS = value ? `player-${playersTurn}` : `hover-${playersTurn}`;

  return (
    <button
      className={"square " + classCSS}
      onClick={onSquareClick}
      style={style}
    >
      {value ? (value > 0 ? "X" : "O") : playersTurn}
    </button>
  );
}
